import React from "react";
import styled from "styled-components";
import { StyledNavbar } from "./StyledNavbar";



export const Navbar = (props: any) => {
  return (
    <StyledNavbar>
      <h3 style={{fontSize:'20px'}}>Tomas Sadone</h3>
      <div>
        <p>WORK</p>
        <p>ABOUT</p>
        <p>CONTACT</p>
      </div>
    </StyledNavbar>
  )
};
